import React from 'react';

const Table = ({age, masculine, feminine, multiculturalAppearance}) => {
    return(
        <div>
            <h1>My react table</h1>
            <table>
                <tbody>
                    <tr><th>Table header</th></tr>
                    <tr>
                        <td>{age}</td>
                        <td>Smith</td>
                        <td>50</td>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}


export default Table;
